import React from 'react'

const Achievement = () => {
  return (
    <div className='game-container'>
        <article>
        <h1>Games</h1>
        <ul>
            {
                games.map( game => (
                    <li>
                        <Link to={'/games/'+game.id}>{game.name}</Link>                    
                    </li>
                ))
            }
        </ul>
        </article>
        <article>
            <Outlet />
        </article>
    </div>
  )
}

export default Achievement
